import { Sidebar } from "../components/Sidebar";
import { Title } from "../components/Title";
import { UserRanked } from "../components/UserRanked";
<link
  href="https://fonts.googleapis.com/css2?family=Montserrat:wght@100;200;300;400;500;600;700;800;900&family=Roboto&display=swap"
  rel="stylesheet"
></link>;

export const Ranking = () => {
  const users = [
    {
      name: "Amet Mattis Vulputate",
      score: "60",
    },
    {
      name: "Amet Mattis Vulputate",
      score: "50",
    },
    {
      name: "Amet Mattis Vulputate",
      score: "40",
    },
    {
      name: "Amet Mattis Vulputate",
      score: "30",
    },
    {
      name: "Amet Mattis Vulputate",
      score: "20",
    },
    {
      name: "Amet Mattis Vulputate",
      score: "10",
    },
    {
      name: "Amet Mattis Vulputate",
      score: "5",
    },
  ];

  return (
    <div className="flex min-h-screen max-w-screen w-full h-full">
      <Sidebar />

      <div className="w-4/5 flex flex-col m-4">
        <Title>Ranking</Title>
        {users.map((item) => {
          return <UserRanked title={item.name} score={item.desc} />;
        })}
      </div>
    </div>
  );
};
